query:
/*+ NoHashJoin(mk t mc) */ select count(*)
from title AS t
inner join movie_keyword AS mk
on t.id = mk.movie_id AND t.kind_id = 7 AND t.production_year < 2007 AND mk.keyword_id > 3953
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id > 11513 AND mc.company_type_id > 1;
